eval("/*jslint browser: true, devel: true */\n\n/**\n * @author Robert The Man Suppenbach\n */\ndefine(\'utilities/core/AjaxHandlers\',[\'jquery\',\n        \'knockoutjs\',\n        \'LoggerConfig\',\n        \'Mediator\'], function ($, ko, LoggerConfig, Mediator) {\n    \'use strict\';\n    \n    var instance;\n    function init() {\n    \t\n    \tvar logger, loadingOverlay, loadingTimer, saveOverlay, \n        loadingOverlays = 0, savingOverlays = 0, \n        loadingModel = {loadingCount : ko.observable(loadingOverlays)}, \n        savingModel = {savingCount : ko.observable(savingOverlays)};\n\n        logger = new LoggerConfig().getLogger(\"AjaxHandlers.js\");\n        logger.info(\"Initializing Ajax Handlers\");\n    \t\n    \tfunction registerAjaxListeners() {\n            $(document).ajaxSend(function(event, jqxhr, settings ){\n                logger.debug(\"AJAX\", settings.type,  \"call to server:\", settings.url);\n                \n                if(settings.url.indexOf(\'loading.htm\') < 0 && settings.url.indexOf(\'saving.htm\') < 0){\n                    if(settings.url.indexOf(\'save\') > 0){\n                        Mediator.publish({\"channel\" : \"show-saving\"});\n                    }else{\n                        Mediator.publish({\"channel\" : \"show-loading\"});   \n                    }\n                }\n                \n                if(!settings.async){\n                    setTimeout(function(){\n                        return true;\n                    }, 300);\n                }else{\n                    return true;\n                }\n                \n            });\n            \n            $(document).ajaxComplete(function(event, xhr, settings){\n                logger.debug(\"AJAX\", settings.type, settings.url, \"call to server complete\");\n                \n                if(settings.url.indexOf(\'loading.htm\') < 0 && settings.url.indexOf(\'saving.htm\') < 0){\n                    if(settings.url.indexOf(\'save\') > 0){\n                        Mediator.publish({\"channel\" : \"hide-saving\"});\n                    }else{\n                        Mediator.publish({\"channel\" : \"hide-loading\"});                    \n                    }                    \n                }\n            }); \n            \n            \n            $(document).ajaxSuccess(function(event, xhr, settings) {\n                logger.debug(\'AJAX\', settings.type, settings.url, xhr.status, xhr.statusText, settings.dataType);\n            });\n            \n            $(document).ajaxError(function(event, xhr, settings, exception) {\n                logger.debug(\'AJAX\', settings.type, settings.url, xhr.status, xhr.statusText, settings.dataType, exception);\n                // if we get a 401 we need to return to request login\n            });               \n            \n            \n        }    \t\n    \t\n        Mediator.subscribe({\n            \"channel\": \"show-loading\",\n            \"context\": self,\n            \"callback\": function(){\n                if(!loadingOverlay){\n                    loadingOverlay = $(TemplateManager.getTemplate(\'loading\'));\n                    $(\'body\').prepend(loadingOverlay);\n                    ko.applyBindings(loadingModel, loadingOverlay[0]);\n                }\n\n                loadingOverlays++;\n                loadingModel.loadingCount(loadingOverlays);\n                if(!$(loadingOverlay).is(\':visible\')){\n                    $(loadingOverlay).fadeIn(250);\n                    if(!$(\"body\").hasClass(\'wait\')){\n                        $(\"body\").addClass(\"wait\");\n                    } \n                }                  \n            }\n        });\n        Mediator.subscribe({\n            \"channel\": \"hide-loading\",\n            \"context\": self,\n            \"callback\": function(){\n                if(loadingOverlay){\n                    loadingOverlays--;\n                    \n                    if(loadingOverlays < 1){\n                        loadingOverlays = 0;\n                        $(loadingOverlay).fadeOut(500, function(){\n                            if($(\"body\").hasClass(\'wait\')){\n                                $(\"body\").removeClass(\"wait\");  \n                            }                                \n                        });\n                    }else{\n                        loadingModel.loadingCount(loadingOverlays);\n                    }\n                }                  \n            }\n        });             \n        Mediator.subscribe({\n            \"channel\": \"show-saving\",\n            \"context\": self,\n            \"callback\": function(){\n                if(!saveOverlay){\n                    saveOverlay = $(TemplateManager.getTemplate(\'saving\'));\n                    $(\'body\').prepend(saveOverlay);\n                    ko.applyBindings(savingModel, saveOverlay[0]);\n                }\n\n                savingOverlays++;\n                savingModel.savingCount(savingOverlays);\n                \n                if(!$(saveOverlay).is(\':visible\')){\n                    $(saveOverlay).fadeIn(250);\n                }                    \n            }\n        });\n        Mediator.subscribe({\n            \"channel\": \"hide-saving\",\n            \"context\": self,\n            \"callback\": function(){\n                setTimeout(function(){\n                    if(saveOverlay){\n                        savingOverlays--;\n                        \n                        if(savingOverlays < 1){\n                            savingOverlays = 0;\n                            $(saveOverlay).fadeOut(500);\n                        }else{\n                            savingModel.savingCount(savingOverlays);\n                        }\n                    }                          \n                }, 1);\n              \n            }\n        });  \n        \n        return {\n            \"registerAjaxListeners\": registerAjaxListeners\n        }; \n    }\n    \n    return (function () {\n        if (!instance) {\n            instance = init();\n            instance.registerAjaxListeners();\n        }\n        return instance;\n    }());  \n            \n            \n});\n//# sourceURL=/js/utilities/core/AjaxHandlers.js");

eval("/*jslint browser: true, devel: true */\n\n/**\n * @author Robert The Man Suppenbach\n */\ndefine(\'model/user/UserModel\',[\'LoggerConfig\',\n        \'Mediator\', \n        \'knockoutjs\'], function(LoggerConfig, Mediator, ko) {\n\n    /**\n     * @constructor\n     */\n    function UserModel(config) {\n    \tvar self = this;\n    \tself.logger = new LoggerConfig().getLogger(\'UserModel.js\'); \n    \t\n    \tif(config){\n        \tself.initialize(config);    \t\t\n    \t}\n    }\n\n    UserModel.prototype.logger = undefined;\n    \n    UserModel.prototype.username = ko.observable(undefined);\n\n    UserModel.prototype.password = ko.observable(undefined);\n    \n    UserModel.prototype.enabled = ko.observable(undefined);\n    \n    UserModel.prototype.error = ko.observable(undefined);\n    \n    UserModel.prototype.initialize = function (config) {\n        var self = this, c, options = $.extend({}, config);\n        \n        self.logger.info(\'UserModel Initialize\');\n        \n        for (c in options) {\n            if (options.hasOwnProperty(c) && typeof self[c] === \'function\') {\n                self[c](options[c]);\n            }else if (options.hasOwnProperty(c)){\n                self[c] = options[c];\n            }\n        }\n    };\n    \n    // Return the function\n    return UserModel;\n});\n//# sourceURL=/js/model/user/UserModel.js");

